import React from 'react';
import Paper from "@material-ui/core/Paper";


const Question = props => {

    const question = props.getquestionid(props.id);

    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{props.id}</p>
            <p>{question.title}</p>

        </Paper>
    )
}

export default Question;
